import React from 'react';
import JobInfo from '../JobInfo';
import airbnb from '../../images/airbnb.jpeg';

const index = () => {
    return (
        <div className='google'>
        <JobInfo
            source={airbnb}
            company='Google'
            job='UX Design Lead, Next Billion Users'
            time='3 days ago'
            applied='6 applied'
            location='Singapore'
        />
        </div>
    )
}

export default index
